import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import './Navbar.css';
import logo from '../../assets/img/mblogo_long_wd.png';

const navbar = (props) => {

    if(!props.showModal) { 
        return (
            <div className='nav_nav'>
                <nav className="navbar navbar-light bg-light">
                    <Link to='http://www.mongobyte.com'>
                    <img src={logo}  className="d-inline-block align-top" alt=""></img></Link>
                        <ul className="nav_ul">
                        <li><a href='#'>Find a Brewery</a></li>
                            <li><a href='#'>Find a Brewery</a></li>
                            <li><a href='#'>About MongoByte</a></li>
                            <li><Link to='../../containers/Contact'>Contact Us</Link></li>
                        </ul> 
                </nav>
                <Route
                    path="/"
                    component={Landing}
                    exact 
                />
                <Route
                    path="/find"
                    component={Find}
                    exact 
                />
                <Route
                    path="/about"
                    component={About}
                    exact 
                />
                <Route
                    path="/contact"
                    component={Contact}
                    exact 
                />
            </div>
        );
    };

        return (
            <div className='nav_nav'>
                <nav className="navbar navbar-light bg-light">
                    <img src={logo}  className="d-inline-block align-top" alt="" />
                    <ul className="nav_ul">
                        <li>Find a Brewery</li>
                        <li>About MongoByte</li>
                        <li>Contact Us</li>
                    </ul> 
                </nav>
            </div>
        );
    };


export default navbar;
